import React, { Component } from 'react'

export default class PeopleMovies extends Component {
    render() {

        const {profiles, users, movies} = this.props;
        const moviesList = Object.values(movies)
        // const ShowList = profiles;
        return (
            <ul> 
            {moviesList.map(movie => (
              <li key={movie.id}>
                  <h2>{movie.name}</h2>
                  <h3>Liked By : </h3>

              </li>
            ))}
            </ul>
        )
    }
}
